import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <body>
      <nav class="navbar">
        <div class="col-2 drawer">
          <button type="button" class="btn btn-default">
            <span class="glyphicon glyphicon-menu-hamburger drawer-icon"></span>
          </button>
        </div>
        <div class="col-2 empty"></div>
        <div class="col-4 homelogo nav1 "> teste</div>
        <div class="col-4 homelogo">Home logo</div>
        <div class="col-4 homelogo nav3 ">teste</div>
        <div class="col-4 empty"></div>
      </nav>
      <h1>TESTE!</h1>
    </body>
  );
}

export default Home;
